const ProfileInfo = (props) =>{
     if (!props.profile)
return <img className={s.main_img}
            src="https://bessarabiainform.com/wp-content/uploads/2019/02/continuous-integration-for-react-native.png" alt=""/>

    return         <div>

            <img src={props.profile.photos.large !=null ? props.profile.photos.small:userPhoto} />
<div>
    {props.profile.fullName}
</div>
        <div>{props.profile.photos.large}</div>


        </div>
}
export default ProfileInfo;
